$grid-width: 100%;
$inner-grid-width: 70%;
$gutter-vertical: 1rem;
$gutter-horizontal: 4rem;

%grid {
    max-width: $inner-grid-width;
    display: grid;
    margin: 0 auto;
    gap: $gutter-horizontal;
    @include respond(big-desktop) {
        // width > 1800?
        max-width: 55%; //1rem = 12px, 12/16 = 75%
        gap: 4.4rem;
    }
    @include respond(desktop) {
        // width > 1500?
        max-width: 75%; //1rem = 12px, 12/16 = 75%
        gap: 3.2rem;
    }
    
    @include respond(tab-land) {
        // width < 1200?
        max-width: 85%; // 1rem = 8px, 8/16 = 50p%
        gap: 2.4rem;
    }

    @include respond(tab-port) {
        // width < 900?
        max-width: 85%; // 1rem = 8px, 8/16 = 50p%
        gap: 8rem;
        // justify-items: center;
    }
    @include respond(phone) {
        // width < 1200?
        max-width: 90%; //1 rem = 9px, 9/16 = 56.25%
    }
}

%even-grid {
    display: grid;
    margin: 0 auto;
    grid-template-columns: 1fr 1fr;
    gap: $gutter-horizontal;
    @include respond(tab-port) {
        grid-template-columns: none;
        grid-template-rows: none;
    }
