        display: grid;

        &--contacts {
            gap: 0 2rem;
            justify-content: start;
            grid-row: 1;
            opacity: 0.7;
        }
        &--menu {
            float: right;
            grid-template-columns: auto;
                gap: 0 3.2rem;
            @include respond(big-desktop) {
                gap: 0 4rem; // 1rem = 8px, 8/16 = 50%
            }
            @include respond(desktop) {

                // width < 1500?
                gap: 0 2.4rem; // 1rem = 8px, 8/16 = 50%
            }
            @include respond(tab-land) {
                // width < 1200?
                gap: 0 2.5rem; // 1rem = 8px, 8/16 = 50%
            }
            @include respond(tab-port) {
                // width < 900?
                gap: 0 2rem; // 1rem = 8px, 8/16 = 50%
            }
            @include respond(phone) {
                // width < 1200?
                gap: 0 1rem; //1 rem = 9px, 9/16 = 56.25%
            }
        }
    }

    &__logo {
        float: left;
        opacity: .6;
        display: grid;
        transition: all 0.5s ease;        
        justify-content: center;
    }

    //! STYLING

    &__menu {
        list-style: none;
        text-wrap: nowrap;
        font-size: 1.4rem;
        line-height: 2rem;

        &__top {
            grid-row: 1;
            letter-spacing: .2px;
            font-weight: 100;

            &--hover {
                &:link,
                &:visited {
                    opacity: 0.9;
                    color: black;
                    transition: all 0.2s;
                }
                &:hover {
                    color: $color-tertiary;
                }
            }
        }

        &__bottom {
        padding: 2rem 0rem;

            vertical-align: middle;
            display: flex;
            grid-row: 2;
            position: relative;

            &--active {
                background-image: linear-gradient(
                    to bottom,
                    $color-tertiary,
                    $color-tertiary
                );
                background-clip: text;
                -webkit-text-fill-color: transparent;
            }
        }

        &--arrow {
            margin-left: 0.4rem;
            margin-top: .7rem;
            margin-bottom: -7rem;
        }
    }
    &__checkbox {        
        display: none;
    }

    @include respond(desktop) {
        width: 70%;
    }

    @include respond(tab-land) {
        width: 80%;
    }

    @include respond(tab-port) {
        width:  100%;
        height: 100%;
        grid-template-rows: none;
        
        &__icon {
            margin-top: 3.5rem;
            position: relative;
    
            &,
            &::before,
            &::after {
                width: 3rem;
                height: 2px;
                background-color: gray;
                display: inline-block;
                transition: all 0.2s;
            }
    
            &::before,
            &::after {
                content: "";
                position: absolute;
                left: 0;
            }
    
            &::before {
                top: -0.8rem;
                // ANOTHER HELPFUL PROPERTY
                // transform-origin: right;
            }
            &::after {
                top: 0.8rem;
            }
        }
    
        
        &__button {
            float: right;
            height: 7rem;
            width: 7rem;
            z-index: 30;
            // box-shadow: 0 1rem 3rem rgba($color-black, 0.1);
            text-align: center;
            cursor: pointer;
        }

        &__button:hover &__icon::before {
            top: -1rem;
        }
    
        &__button:hover &__icon::after {
            top: 1rem;
        }

    
        &__grid--menu {
            display: none;
        }

        &__container--top {
            display: none
        }        
    }
}

