.table {
    text-align: left;
    border-collapse: collapse;
    align-self: self-start;
    &__header {
        & > * {
            padding-bottom: 1rem;
            font-style: oblique;
        }
    }
    &__header,
    &__items {
        line-height: 4rem;
        text-wrap: nowrap;
        & > :nth-child(1),
        & > :nth-child(2) {
            font-family: "Nunito";
            font-weight: 400;
            font-size: 1.8rem;
        }
        & > :nth-child(2) {
            text-align: right;
        }
    }

    &__description {
        & > * {
            color: #666666;
            font-size: 1.4rem;
            font-style: italic;
            text-align: left;
            padding: 0 3rem;
        }
    }
}
